import React from 'react';
import '../styles/Footer.css'


function Footer() {

    return (
   <div class="foot-center">   
    <div class="footer-row" id="container-footer">
        <div className="footer ul">
            <ul>
            <li class="row">
            <a className="contact-links col-4" href="https://github.com/MaryiaVinogradova" target="_blank"><i
                className="bi bi-github" id="icon"></i></a>
            </li>

            <li class="row">
            <a className="contact-links col-4" href="https://www.linkedin.com/in/maryiavinogradova/"
                target="_blank"><i className="bi bi-linkedin" id="icon"></i></a>
            </li>
            </ul>

        </div>
    </div>
   </div>   
    );
}

export default Footer;
